import React from 'react'
import { useContext } from 'react';
import { themeContext } from '../../Context';
import './Footer.css' ;


const Footer = () => {
  const theme = useContext(themeContext);
  const darkMode = theme.state.darkMode;
  return (
    <div className='footer'>
      <div className='text' style={{background: darkMode?'#38e781': ''}}>
        <p>Hello Sir Thank you for Visiting My Portfolio  Please Contact If any Query</p>
        
      </div>
      <p >copyrights &copy; Arbaj Patel</p>
    </div>
  )
}

export default Footer
